import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UsersPageModule } from './pages/users.page-module';
import { RoutesPath } from './routes.enum';
import {
  UserDetailsComponent
} from '../../projects/user-albums/src/lib/adapters/primary/components/user-details/user-details.component';

const routes: Routes = [
  {
    path: RoutesPath.ROOT,
    redirectTo: RoutesPath.USERS,
    pathMatch: 'full',
  },
  {
    path: RoutesPath.USERS,
    loadChildren: () => UsersPageModule,
  },
  {
    path: `${RoutesPath.USERS}/:id`,
    loadChildren: () => UserDetailsComponent,
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
